	//@Async
	public String teste(String destino) throws Exception{
		
		try {
		
			MimeMessage message = javaMailSender.createMimeMessage();
		    MimeMessageHelper helper;
		    helper = new MimeMessageHelper(message, true);
		    helper.setFrom(from);
		    helper.setSubject("Teste de E-mail GD");
		    helper.setTo(destino);
		    helper.setText("<html><table><tr><td>Teste de envio de e-mail Gd</td></tr></table></html>", true);
		    javaMailSender.send(message);
			
	        return "Enviado";
			
		}catch (Exception e) {
        	logger.error(String.format("Erro ao enviar e-mail de teste para %s erro %s", destino, e));
        	throw e;
        }
	}
	
	@Async
	public void recuperaSenha(EmailDto emailDto) {
		
	   try {
		  
		   MimeMessage mail = javaMailSender.createMimeMessage();
		   
		   MimeMessageHelper helper = new MimeMessageHelper( mail );
		   
		   helper.setFrom(from);
		   helper.setTo( emailDto.getEmailDestino());
		   helper.setText( layoutResetSenha(emailDto.getMensagem()[0], emailDto.getMensagem()[1]) ,true);
		   helper.setSubject(emailDto.getAssunto());
 
           javaMailSender.send(mail);
            
           logger.info("E-mail enviado");
            
        }catch (Exception e) {
        	logger.error(String.format("Erro ao enviar e-mail de recuperação de senha %s", e));
        }
	}
	
	
	@Async
	public void deleteArquivo(EmailUploadArquivoDto emailDto) {
		
	   try {
		  
		   MimeMessage mail = javaMailSender.createMimeMessage();
		   
		   MimeMessageHelper helper = new MimeMessageHelper( mail );
 
		   String[] emailDestino = getEmailCliente(emailDto.getIdCliente());
		   String[] emailAdmin = getEmailAdmin();
                
            
           if( emailDestino != null ) {
        	   helper.setTo( emailDestino );
        	   if(emailAdmin != null && emailAdmin.length > 0 ) {
        		   helper.setCc(emailAdmin );
        	   }
           }else {
        	   if(emailAdmin != null && emailAdmin.length > 0 ) {
        		   helper.setTo(emailAdmin );
        	   } 
           }
  
           helper.setFrom(from);
           helper.setSubject(emailDto.getAssunto());
           helper.setText( layoutDeletaDocumento( emailDto.getMensagem()[0] , emailDto.getMensagem()[1], emailDto.getMensagem()[2]) ,true);
 
           javaMailSender.send(mail);
            
           logger.info("E-mail enviado");
            
	   }catch (Exception e) {
		   logger.error(String.format("Erro ao enviar e-mail de upload de arquivo %s", e));
       }
	}
	
	@Async
	public void uploadArquivo(EmailUploadArquivoDto emailDto) {
		
	   try {
		  
		   MimeMessage mail = javaMailSender.createMimeMessage();
		   
		   MimeMessageHelper helper = new MimeMessageHelper( mail );
 
		   String[] emailDestino = getEmailCliente(emailDto.getIdCliente());
		   String[] emailAdmin = getEmailAdmin();
               
           if( emailDestino != null ) {
        	   helper.setTo( emailDestino );
        	   if(emailAdmin != null && emailAdmin.length > 0 ) {
        		   helper.setCc(emailAdmin );
        	   }
           }else {
        	   if(emailAdmin != null && emailAdmin.length > 0 ) {
        		   helper.setTo(emailAdmin );
        	   } 
           }
  
           helper.setFrom(from);
           helper.setSubject(emailDto.getAssunto());
           helper.setText( layoutUpload( emailDto.getMensagem()[0] , emailDto.getMensagem()[1], emailDto.getMensagem()[2]) ,true);
 
           javaMailSender.send(mail);
            
           logger.info("E-mail enviado");
            
	   }catch (Exception e) {
		   logger.error(String.format("Erro ao enviar e-mail de upload de arquivo %s", e));
       }
	}
	
	private String[] getEmailCliente(String idCliente) {
		
		List<UsuarioModel> listaUsuarioModel = usuarioRepository.findByClienteId(idCliente);
		
		List<String> emails = listaUsuarioModel
				.stream()
				.map( u -> u.getEmail() )
				.collect(Collectors.toList());
		
		if( emails != null && !emails.isEmpty() ) {
			return emails.stream().toArray(String[]::new);
		}
		return null;
		
	}
	
	private String[] getEmailAdmin() {
		
		List<UsuarioModel> listaUsuarioModel = usuarioRepository.findByPerfil(RoleEnum.ROLE_MASTER.name());
		
		List<String> emails =  listaUsuarioModel
				.stream()
				.map( u -> u.getEmail() )
				.collect(Collectors.toList());
		
		if( emails != null && !emails.isEmpty() ) {
			return emails.stream().toArray(String[]::new);
		}
		return null;
	}
	
